SPEC_SENTENCE_INDICES = [8075, 8076, 132621, 62223, 62224, 132626, 85395, 126867, 85397, 85396, 126868, 8344, 85398, 8345, 91423, 85408, 91425, 91424, 85409, 91426, 23206, 23207, 62120, 62121, 70189, 70190, 85435, 85436, 23357, 23358, 18878, 23359, 18879, 18883, 18884, 126917, 126918, 107888, 107889, 129525, 129526]
class ShuffledLambdaTermsDataset(Dataset):
    def __init__(self, input_sentences_file, main_dir, transform=None, target_transform=None, last=False, inference=False):
        self.main_dir = main_dir
        self.input_sentences = pd.read_csv(input_sentences_file, header=None)
        self.transform = transform
        self.target_transform = target_transform
        self.last = last
        self.inference = inference
    
    def __len__(self):
        return len(self.input_sentences)

    def __getitem__(self, index):
        path = self.input_sentences.iloc[index, 2]

        if self.inference:
            gen_sent = eval(self.input_sentences.iloc[index, 1])
            sent, _ = preprocess_sent(gen_sent)
            sent = sent.input_ids

        if type(path) is not str: path = path.name
        txtpath = self.main_dir + path[len("lambdaBERT/data/"):]
        path = self.main_dir + path[len("lambdaBERT/data/"):]
        with open(txtpath, 'r') as f:
            lambda_terms = f.readlines()[0].strip()

        # remove the ")" from the lambda_term:
        lambda_terms = lambda_terms.replace(")", "")
        sent_embs, sent_embs_last, target_embs, target_embs_last, target_tokens, var_index_mask_no, lambda_index_mask, app_index_mask = torch.load(path.replace("txt", "pt"))#create_out_tensor(sentence, lambda_terms)

        if len(target_embs) == 0:
            if "section_6186/4.txt" in path or "section_4652/5.txt" in path or "section_7065/2.txt" in path or "/section_5020/4.txt" in path:
                target_embs = torch.Tensor()
                target_tokens = []
                assert len(lambda_index_mask) == 0 
                assert len(var_index_mask_no) == 0
                assert len(app_index_mask) == 0

                # lambda_index_mask.append(0)
                # var_index_mask_no.append(0)
                # app_index_mask.append(0)
            else:
                raise Exception

        #sep token for target embedding:
        target_embs = torch.cat([torch.tensor(BOS_TOKEN[os.environ["BERT_TYPE"]]).squeeze(0), target_embs, torch.tensor(SEP_TOKEN[os.environ["BERT_TYPE"]]).squeeze(0)], dim=0)
        target_embs_last = torch.cat([torch.tensor(BOS_TOKEN[os.environ["BERT_TYPE"]]).squeeze(0), target_embs_last, torch.tensor(SEP_TOKEN_LAST[os.environ["BERT_TYPE"]]).squeeze(0)], dim=0)
        target_tokens = [BOS_ID[os.environ["BERT_TYPE"]]] + target_tokens + [SEP_ID[os.environ["BERT_TYPE"]]]
        lambda_index_mask = [0] + lambda_index_mask + [0]
        var_index_mask_no = [0] + var_index_mask_no + [0]
        app_index_mask = [0] + app_index_mask + [0]
        stop_index_mask = [0]*len(app_index_mask)
        stop_index_mask[-1] = 1

        # print("insnide", TOKENIZER.convert_ids_to_tokens([101 if t <0 else t for t in target_tokens]))
        if self.inference:
            return sent,  sent_embs if not self.last else sent_embs_last, target_embs if not self.last else target_embs_last, target_tokens, lambda_index_mask, var_index_mask_no, app_index_mask, stop_index_mask
        return sent_embs if not self.last else sent_embs_last, target_embs if not self.last else target_embs_last, target_tokens, lambda_index_mask, var_index_mask_no, app_index_mask, stop_index_mask

def shuffled_collate(batch):
    try:
        sent_embedding, lambda_term_embedding, lambda_term_tokens, lambda_mask, var_mask, app_mask, stop_mask = zip(*batch)
        sents = None
    except: 
        sents, sent_embedding, lambda_term_embedding, lambda_term_tokens, lambda_mask, var_mask, app_mask, stop_mask = zip(*batch)
    
    sent_embedding, lambda_term_embedding, lambda_term_tokens, lambda_mask, var_mask, app_mask, stop_mask = [sent.squeeze(0) for sent in sent_embedding], [lambda_term.squeeze(0) for lambda_term in lambda_term_embedding], [torch.tensor(sent, dtype=torch.int64) for sent in lambda_term_tokens],[torch.tensor(sent, dtype=torch.bool).squeeze(0) for sent in lambda_mask], [torch.tensor(var, dtype=torch.int64).squeeze(0) for var in var_mask], [torch.tensor(app, dtype=torch.bool).squeeze(0) for app in app_mask], [torch.tensor(st, dtype=torch.bool).squeeze(0) for st in stop_mask]
    
    if sents is not None: sents = [sent.squeeze(0) for sent in sents]
    #assert all(sents[i].shape == sent_embedding[i].shape[:-1] for i in range(len(sents))) , f"sent_embedding shape: {[sent_embedding[i].shape for i in range(len(sent_embedding))]} and sents shape: {[sents[i].shape for i in range(len(sents))]} do not match"

    sent_embedding_batched = pad_sequence(sent_embedding, batch_first=True, padding_value = 15)
    lambda_term_embedding_batched = pad_sequence(lambda_term_embedding, batch_first=True, padding_value = 15)
    lambda_term_tokens_batched = pad_sequence(lambda_term_tokens, batch_first=True, padding_value = SEP_ID[os.environ["BERT_TYPE"]]) # all pads are stops
    var_mask_batched = pad_sequence(var_mask, batch_first=True, padding_value = 0)
    lambda_mask_batched = pad_sequence(lambda_mask, batch_first=True, padding_value = 0)
    app_mask_batched = pad_sequence(app_mask, batch_first=True, padding_value = 0)
    stop_mask_batched = pad_sequence(stop_mask, batch_first=True, padding_value = 1) # all pads are stops
    if sents is not None: sent_batched = pad_sequence(sents, batch_first=True, padding_value = SEP_ID[os.environ["BERT_TYPE"]])

    lambda_pad_mask = lambda_term_embedding_batched == 15
    lambda_term_embedding_batched = lambda_term_embedding_batched.masked_fill(lambda_pad_mask, 0)
    lambda_pad_mask = lambda_pad_mask.sum(-1) >= 1 #so anything thats a padded token position is 0

    # #make all the pad embeddings be the sep token embeddings
    # lambda_term_embedding_batched[lambda_pad_mask] = torch.tensor(SEP_TOKEN_LAST).reshape(1, -1) -- #NOT DOING ANYMORE

    sent_pad_mask = sent_embedding_batched == 15
    sent_embedding_batched = sent_embedding_batched.masked_fill(sent_pad_mask, 0)
    sent_pad_mask = sent_pad_mask.sum(-1) >= 1 #similarly, anything thats a padded token position is 0
    # sent_pad_mask = sent_embedding_batched.sum(-1) >= 1
    if sents is not None:
        return sent_batched, sent_embedding_batched, lambda_term_embedding_batched, lambda_term_tokens_batched, var_mask_batched, lambda_mask_batched, app_mask_batched, stop_mask_batched, lambda_pad_mask, sent_pad_mask
    return sent_embedding_batched, lambda_term_embedding_batched, lambda_term_tokens_batched, var_mask_batched, lambda_mask_batched, app_mask_batched, stop_mask_batched, lambda_pad_mask, sent_pad_mask

import numpy
def seed_worker(worker_id):
    worker_seed = torch.initial_seed() % 2**32
    numpy.random.seed(worker_seed)
    random.seed(worker_seed)

def data_init(batch_size, last=False, inference=False, rem_spec_sentences=False, data_path=DATA_PATH):

    #load in the tokenizer
    # tokenizer = BertTokenizer.from_pretrained("bert-base-uncased")
    data_path = data_path if data_path != "" else DATA_PATH 
    print("Data path is ", data_path)
    dataset = ShuffledLambdaTermsDataset(data_path+'input_sentences.csv', data_path, last=last, inference=inference)

    with open(data_path+"/dataset_splits.pkl", "rb") as f:
        train_indices, val_indices, test_indices = pickle.load(f)

    if rem_spec_sentences:
        # Filter out special sentences from each split
        train_indices = [i for i in train_indices if i not in SPEC_SENTENCE_INDICES]
        val_indices = [i for i in val_indices if i not in SPEC_SENTENCE_INDICES]
        test_indices = [i for i in test_indices if i not in SPEC_SENTENCE_INDICES]
    
    train_dataset, val_dataset, test_dataset = Subset(dataset, train_indices), Subset(dataset, val_indices), Subset(dataset, test_indices)
    train_dataloader = DataLoader(train_dataset, batch_size=batch_size, shuffle=not inference, num_workers=12, collate_fn=shuffled_collate)
    val_dataloader = DataLoader(val_dataset, batch_size=batch_size, shuffle=False, num_workers=12, collate_fn=shuffled_collate)
    test_dataloader = DataLoader(test_dataset, batch_size=batch_size, shuffle=False, num_workers=12, collate_fn=shuffled_collate)
    return train_dataloader, val_dataloader, test_dataloader